import React from 'react';
import Card from "./Card";
import Sdata from "./SkillData";
const Skills = () => {
    return (
        <>
            <section id="header" className="d-flex align-items-center bgb">

                <div className="my-5 bcp">
                    <h1 className="text-center title">Skills</h1>

                    <div className="container-fluid  mb-5 bcp ">
                        <div className="row ">
                            <div className="col-10 mx-auto">
                                <div className="row gy-4 h-100 d-flex align-items-stretch">
                                    {
                                        Sdata.map((val, ind) => {
                                            return <Card key={ind}
                                                imgsrc={val.imgsrc}
                                                title={val.title}
                                            />
                                        })
                                    }


                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </section>
        </>
    )
}
export default Skills;
